function EMConsoleReporter(a){a.on("agentExecutionStarted",function(a,b){logger.info("AGENT ID: "+a.id+" - execution started: ",b)}),a.on("executionStarted",function(a,b,c){logger.info(b.type+": Execution Started: ",b,c)}),a.on("executionEnded",function(a,b,c,d){logger.info(b.type+": Execution Ended: ",b,c,d)}),a.on("executionError",function(a,b,c){logger.info(b.type+": EXECUTION ERROR: ",c)}),a.on("agentExecutionEnded",function(a,b){logger.info("AGENT ID: "+a.id+" - execution ended: ",b)})}var logger=require("./logger.js");module.exports=EMConsoleReporter;